<script>
var slideIndex = 0;
carousel();
function carousel() {
    var i;
    var x = document.getElementsByClassName("mySlides");
    for (i = 0; i < x.length; i++) {
      x[i].style.display = "none";
    }
    slideIndex++;
    if (slideIndex > x.length) {slideIndex = 1}
    x[slideIndex-1].style.display = "block";
    // Wait 5 seconds for the first frame
    if (slideIndex == 1) {setTimeout(carousel, 5000);}
    // else set the user defined period
    else {setTimeout(carousel, 50);}
}
</script>
